              </Button>
              <Button
                className="btn-round"
                color="info"
                href= {addresss.locationfinal}
                outline
                size="lg"
                target="_blank"
              >
                길찾기
              </Button>
            </Col>
          </Row>
        </Container>
      </div>
    </>
    
  );
}

export default Suggest;
